import { Component } from "react";
import ListOfEmojis from '../component/emoji-list.js';

class AllSymbols extends Component{
    render(){
        return(
            <div>
              
                    {
                        ListOfEmojis.map((item,index)=>{
                           return(
                              <div id={item.text} className={item.text}> 
                                   {item.Symbol}
                                   {item.text}
                              </div>
                           )
                          
                        })
                    }


          
            </div>
        )
    }
}

export default AllSymbols;
